import React from "react";
import logo from "./logo.svg";
import "./App.css";

function App() {
  return (
    <div className="App">
      <div className="main">
        <div className="header">
          Статистика профиля в ваших любимых социальных сетях
        </div>
      </div>
    </div>
  );
}

export default App;
